import { NavLink } from 'react-router-dom';
import log from '../assets/logosn.svg';

const NavigationBar = () => {
    return<>
    <header>
        <nav>
            <img src={logo}></img>
        <NavLink to ="/home">Home</NavLink>
        <NavLink to ="/messages">Messages</NavLink>
        </nav>
    </header>
    </>
}

export default NavigationBar;
